import React, { useState } from "react";

const CBOform = () => {
  const [formData, setFormData] = useState({
    org_registration: "",
    date_established: "",
    psic_code: "",
    target_members: "",
    number_of_members: { male: 0, female: 0, total: 0 },
    annual_production: [], // Stores production items
    production_scope: "",
    sales_scope: "",
    total_assets: 0,
    total_liabilities: 0,
    annual_gross_income: 0,
    procurement_experience: [],
    sponsor_agency: "",
    other_sponsor_agency: "",
  });

  // ðŸ›  Handle Input Changes for Simple Fields
  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  // ðŸ›  Handle Change for `number_of_members`
  const handleMemberChange = (e) => {
    const { name, value } = e.target;
    const numValue = parseInt(value, 10) || 0;
    setFormData((prevData) => ({
      ...prevData,
      number_of_members: {
        ...prevData.number_of_members,
        [name]: numValue,
        total: prevData.number_of_members.male + prevData.number_of_members.female + (name === "male" || name === "female" ? numValue : 0),
      },
    }));
  };

  // ðŸ›  Handle Adding an Item to `annual_production`
  const addProductionItem = () => {
    setFormData((prevData) => ({
      ...prevData,
      annual_production: [...prevData.annual_production, { product: "", type: "", quantity: 0, unit: "", market_value: 0 }],
    }));
  };

  // ðŸ›  Handle Change for `annual_production`
  const handleProductionChange = (index, e) => {
    const { name, value } = e.target;
    const newProduction = [...formData.annual_production];
    newProduction[index] = { ...newProduction[index], [name]: value };
    setFormData({ ...formData, annual_production: newProduction });
  };

  // ðŸ›  Handle Submitting the Form
  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await fetch("http://localhost:4000/api/cbos", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(formData),
      });

      if (response.ok) {
        alert("CBO Registered Successfully!");
      } else {
        alert("Failed to Register CBO");
      }
    } catch (error) {
      console.error("Error submitting form:", error);
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      {/* ðŸ“Œ Organization Registration */}
      <label>Organization Registration:</label>
      <input type="text" name="org_registration" value={formData.org_registration} onChange={handleChange} required />

      {/* ðŸ“Œ Date Established */}
      <label>Date Established:</label>
      <input type="date" name="date_established" value={formData.date_established} onChange={handleChange} required />

      {/* ðŸ“Œ Male & Female Members */}
      <label>Male Members:</label>
      <input type="number" name="male" value={formData.number_of_members.male} onChange={handleMemberChange} />
      <label>Female Members:</label>
      <input type="number" name="female" value={formData.number_of_members.female} onChange={handleMemberChange} />
      <p>Total Members: {formData.number_of_members.total}</p>

      {/* ðŸ“Œ Annual Production */}
      <h3>Annual Production</h3>
      {formData.annual_production.map((item, index) => (
        <div key={index}>
          <input type="text" name="product" placeholder="Product" value={item.product} onChange={(e) => handleProductionChange(index, e)} required />
          <input type="text" name="type" placeholder="Type" value={item.type} onChange={(e) => handleProductionChange(index, e)} required />
          <input type="number" name="quantity" placeholder="Quantity" value={item.quantity} onChange={(e) => handleProductionChange(index, e)} required />
          <input type="text" name="unit" placeholder="Unit" value={item.unit} onChange={(e) => handleProductionChange(index, e)} required />
          <input type="number" name="market_value" placeholder="Market Value" value={item.market_value} onChange={(e) => handleProductionChange(index, e)} required />
        </div>
      ))}
      <button type="button" onClick={addProductionItem}>+ Add Product</button>

      {/* ðŸ“Œ Sponsor Agency */}
      <label>Sponsor Agency:</label>
      <input type="text" name="sponsor_agency" value={formData.sponsor_agency} onChange={handleChange} required />

      {/* ðŸ“Œ Submit Button */}
      <button type="submit">Register</button>
    </form>
  );
};

export default CBOform;
